import React, {Component, Fragment} from 'react';
import {Route, NavLink, Link} from 'react-router-dom'
import Logout from '../util/Logout';
import '../styles/style.css';
import '../styles/dash.css';
import Quotes from './Quotes';
import Screener from './Screener'
import Lookup from './Lookup'
import Watchlist from './Watchlist'
import Chart from './Ticker/Chart'
import Summary from './Ticker/Summary'
import Statistic from './Ticker/Statistic'

class Dashboard extends Component {
  state = {
    chartsTicker: null,
    isActive: "watchlist"
  }
  componentWillUnmount =() => {
    this.setState({
      chartsTicker: null
    })
      }

  setChartsTicker = (ticker) => {
    this.setState({
      chartsTicker: ticker,
      isActive: "summary"
    })
    
  }
  onClickTagHandler =(name)=> {
    this.setState({isActive: name})
  }
  render() {  

  let appLogout= [<Logout clicked={this.props.clicked}/>]

  let routeList = [
    <Route exact path="/dashboard/watchlist"  render={(props)=>
      <Watchlist chartsTicker={this.state.chartsTicker} {...props} />}/>,
    <Route exact path="/dashboard/lookup"  render={(props)=>
      <Lookup chartsTicker={this.state.chartsTicker} {...props} />}/>,
    <Route exact path="/dashboard/screener"  render={(props)=>
      <Screener chartsTicker={this.state.chartsTicker} {...props} />}/>,
  ]

  return (
      <div>
        <div className='header-container-signed'>
          <div className="header-item header-left">
            <div className="header-box">search symbol</div>
            <div className="header-box" style={{color:"skyblue"}}></div>
            <div className="header-box">save</div>
          </div>
          <div className='header-item header-center'>
            <div className="index">
              Index 1
            </div>
            <div className="index">
              Index 2
            </div>
            <div className="index">
              Index 3
            </div>
            <div className="index">
              Index 4
            </div>
            <div className="index">
              Index 5
            </div>
            <div className="index">
              Index 6
            </div>
          </div>
          <div className="header-item header-right">
            <div className='logo'>{appLogout}</div>
          </div>
        </div>
        <div className="main-container">
          <div className="page">
            <div className="page-header">
              <div className="half-header">
                <div 
                  onClick={this.onClickTagHandler.bind(this,"watchlist")}
                  className={this.state.isActive==="watchlist"?"tag-active":"tag"}
                >
                  <NavLink
                    onClick={this.componentWillUnmount}
                    exact to="/dashboard/watchlist"
                    
                    style={{textDecoration:"none", color:"rgb(28, 104, 243)"}}
                    >watchlist
                  </NavLink>
                </div>
                <div
                  onClick={this.componentWillUnmount}
                  onClick={this.onClickTagHandler.bind(this,"lookup")}
                  className={this.state.isActive==="lookup"?"tag-active":"tag"}
                >
                  <NavLink
                    onClick={this.componentWillUnmount}
                    exact to="/dashboard/lookup"
                    
                    style={{textDecoration:"none", color:"rgb(28, 104, 243)"}}
                    >lookup
                  </NavLink>
                </div>
                <div
                  onClick={this.componentWillUnmount}
                  onClick={this.onClickTagHandler.bind(this,"screener")}
                  className={this.state.isActive==="screener"?"tag-active":"tag"}
                >
                  <NavLink
                    onClick={this.componentWillUnmount}
                    exact to="/dashboard/screener"
                    
                    style={{textDecoration:"none", color:"rgb(28, 104, 243)"}}
                    >screener
                  </NavLink>
                </div>
              </div>
              <div className="half-header">
              </div>
            </div>
            {routeList}
          </div>
        </div>
        </div>
)
  }
}

export default Dashboard
